import React from 'react'
import { NavLink } from 'react-router-dom';
const Cart = () => {
    return ( <>
        <NavLink to="/cart" className='btn btn-outline-primary'>
            <span className='fa fa-shopping-cart me-1' > Cart () </span>
           
        </NavLink>
    </>
    )
}

export default Cart;
